import React, { useState, useEffect } from 'react';
import axios from 'axios';

const DataFrame = () => {
  // const [context, setContext] = useState(null);
  const [posts, setPosts] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [updatedPost, setUpdatedPost] = useState({
    id: null,
    name: '',
    beds: '',
    floor: '',
    Image_url: '',
    furnishing: '',
    super_areas: '',
    area_sqft: ''
  });

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const response = await axios.get('http://localhost:8000/api/posts/');
      setPosts(response.data.posts);
      setLoading(false);
    } catch (error) {
      setError(error);
      setLoading(false);
    }
  };

  const handleDelete = async (id) => {
    try {
      await axios.delete(`http://localhost:8000/delete/${id}/`);
      setPosts(posts.filter(post => post.id !== id));
    } catch (error) {
      console.error('Error deleting post:', error);
    }
  };

  const handleUpdate = (post) => {
    // Set the current post data in the state for updating
    setUpdatedPost({
      id: post.id,
      name: post.name,
      beds: post.beds,
      floor: post.floor,
      Image_url: post.Image_url,
      furnishing: post.furnishing,
      super_areas: post.super_areas,
      area_sqft: post.area_sqft
    });
  };

  const handleSubmitUpdate = async () => {
    try {
      const response = await axios.put(`http://localhost:8000/update/${updatedPost.id}/`, updatedPost);
      console.log('Updated Post:', response.data);
      // Optionally update state or notify user of success
    } catch (error) {
      console.error('Error updating post:', error);
    }
  };

  if (loading) return <div>Loading...</div>;
  if (error) return <div>Error: {error.message}</div>;

  return (
    <div>
      <h1>Contact Page</h1>
      {context && <p className="title">{context.my_title}</p>}
      {Array.isArray(posts) && posts.length > 0 && (
        <table className="dataframe">
          <thead>
            <tr>
              <th>Title</th>
              <th>Beds</th>
              <th>Floor</th>
              <th>Image</th>
              <th>Furnishing</th>
              <th>Super Areas</th>
              <th>Area Sqft</th>
              <th>Delete</th>
              <th>Update</th>
            </tr>
          </thead>
          <tbody>
            {posts.map(post => (
              <tr key={post.id}>
                <td>{post.name}</td>
                <td>{post.beds}</td>
                <td>{post.floor}</td>
                <td>
                  <img src={post.Image_url} alt={post.name} className="image" />
                </td>
                <td>{post.furnishing}</td>
                <td>{post.super_areas}</td>
                <td>{post.area_sqft}</td>
                <td>
                  <button type='button' onClick={() => handleDelete(post.id)}>Delete</button>
                </td>
                <td>
                  <button type='button' onClick={() => handleUpdate(post)}>Update</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
      {context && context.my_number && (
        <ul>
          {context.my_number.map((num, index) => (
            <li key={index}>{num}</li>
          ))}
        </ul>
      )}
      {updatedPost.id && (
        <div>
          <h2>Update Post</h2>
          <form onSubmit={handleSubmitUpdate}>
            <label>
              Title:
              <input type="text" name="name" value={updatedPost.name} onChange={(e) => setUpdatedPost({ ...updatedPost, name: e.target.value })} />
            </label>
            <br />
            <label>
              Beds:
              <input type="text" name="beds" value={updatedPost.beds} onChange={(e) => setUpdatedPost({ ...updatedPost, beds: e.target.value })} />
            </label>
            <br />
            <label>
              Floor:
              <input type="text" name="floor" value={updatedPost.floor} onChange={(e) => setUpdatedPost({ ...updatedPost, floor: e.target.value })} />
            </label>
            <br />
            <label>
              Image URL:
              <input type="text" name="Image_url" value={updatedPost.Image_url} onChange={(e) => setUpdatedPost({ ...updatedPost, Image_url: e.target.value })} />
            </label>
            <br />
            <label>
              Furnishing:
              <input type="text" name="furnishing" value={updatedPost.furnishing} onChange={(e) => setUpdatedPost({ ...updatedPost, furnishing: e.target.value })} />
            </label>
            <br />
            <label>
              Super Areas:
              <input type="text" name="super_areas" value={updatedPost.super_areas} onChange={(e) => setUpdatedPost({ ...updatedPost, super_areas: e.target.value })} />
            </label>
            <br />
            <label>
              Area Sqft:
              <input type="text" name="area_sqft" value={updatedPost.area_sqft} onChange={(e) => setUpdatedPost({ ...updatedPost, area_sqft: e.target.value })} />
            </label>
            <br />
            <button type="submit">Submit Update</button>
          </form>
        </div>
      )}
    </div>
  );
};

export default DataFrame;
